import f from "../../images/felgiNav.jpg";
import a from "../../images/welder_in_action.jpg";
import { List, SingleTile, TilesNav } from "./styled";

export const Tile = () => {
  return <></>;
};

export const Tiles = () => {
  return (
    <TilesNav>
      <List>
        <SingleTile bg={a}>
          <Text>Spawanie & CNC</Text>
        </SingleTile>
        <SingleTile bg={a} />
        <SingleTile bg={f}>Renowacja felg</SingleTile>
      </List>
    </TilesNav>
  );
};
